INSERT INTO `mdt_reports` (`id`, `char_id`, `title`, `incident`, `charges`, `author`, `name`, `date`) VALUES
(1, 'RJT65567', 'Coke processing ', 'Caught processing coke leaves, caught with 10 bags of processed coke. *NOTE* Drug cultivating/manufacturing x1 is removed. ', '{\"Poss. Illegal Contraband\":1,\"Drug Cultivation/Manufacturing\":1}', 'AirahTV', 'Luke Smythe', '09-09-2021 15:22:12'),
(2, 'HZY64883', 'Raided at ilegal cocaine proc location had illegal contraband on him ', 'Guilty', '{\"Poss. Illegal Contraband\":1}', 'BanksyXI', 'Jerry Poppins', '09-09-2021 15:58:33'),
(3, 'GNW54259', 'Reckless Driving', 'Jay McBluntz was caught failing to pull over from an officer. He then lead the police on a 22 minute chase around the county. He was driving in oncoming lanes of traffic and hitting multiple vehicles on the road. He then got out the vehicle and then dragged a driver out their vehicle. He was then arrested and found that the vehicle he was driving was stolen.', '{\"Felony Speeding/Reckless Driving\":1,\"Evading Arrest ( Foot )\":1,\"Attempted Grand Theft Auto\":1,\"Reckless Driving\":1,\"Grand Theft Auto\":1}', 'Mikey', 'Jay Mcbluntz', '09-09-2021 16:03:41'),
(4, 'NAE81160', 'found on person', 'guilty', '{\"Poss. Illegal Contraband\":1}', 'BanksyXI', 'Pat Mcgroin', '09-09-2021 16:04:43'),
(5, 'LTK60944', 'unarmed store robbery', 'responded to a 911 call of a store robbery in progress, unpon arrival myself (SGT N.Maguire 702) witnessed the suspect Tobi Gibbs walk from the rear of the store. he raised his hands on request. the suspects fingerprints were found on the safe in the store, after reading him his rights Tobi Gibbs was found quilty and sentenced to 5months + $100 fine. ', '{\"Attempted/Unarmed Robbery\":1}', 'Irish', 'Tobi Gibbs', '09-09-2021 16:20:35'),
(6, 'HZY64883', 'Jerry runs from police', 'Officers invovled\n@804 L. Haynes\n@807 S. Sanchez\n@702 N. Mcguire\n\nS. Sancehz and L. Haynes observed a black in color 2 door sedan speeding through strawberry ave. The vehicle ran a red light and the officers attempted to catch up to it. When the officers caught up to the vehicle Jerry Poppings refused to pull over. The officers were then in an active 10-80 with jerry. He drove recklessly all over the city and crashed out at movie star way. He then left his vehicle and ran on foot for 100 yards. He then put his hands up and gave up fleeing from officers. The vehicle did not come back to jerry owning it. \n\nIn the cells:\n\n\nMr jerry called for a lawyer in the cells. The officers called Dave jones the lawyer. Both parties were able to come to an agreement on charges and Jerry plead guiltiy.', '{\"Joyriding\":1,\"Felony Evading/Eluding an LEO\":1}', 'ifeltlikerunin', 'Jerry Poppins', '09-09-2021 17:04:35'),
(7, 'HZB22452', 'Scott tries to run from the BCSO', 'Officers involved\n@804 L. Haynes\n@807 S. Sanchez\n@102 T. Fedicini\n\nL. Haynes and S. Sanchez were patroling around legion square. They observed a blue in color moped driving recklesly on the sidewalk going towards pillbox. He was driving on the sidewalk up elgin ave. The officers attempted to pull him over and after 1 min Scott pulled over. The officers told MR. McCall to turn off his moped but he reversed to the side of the car and said no. MR. Mccall then led officers on a 10-80 around the city and took multiple jumps.Mccall took one jump and the officers did also and they collided into MR Mccall. The officers let Scott get back on his moped and the officers proceded to pursue Scott. Scott then turned back onto elgin ave going towards pillbox when he accidently braked checked officers causing the officers to ram him off his moped.Scott was downed in the process and taken to pillbox for medical treatment. \n\nA walter 99 was taken off of him because he does not have a weapon license.\n\n', '{\"Felony Evading/Eluding an LEO\":1,\"Criminal Possession of a Class I Firearm\":1,\"Reckless Driving\":1}', 'ifeltlikerunin', 'Scott McCall', '09-10-2021 12:02:31'),
(8, 'BJM69830', 'Coke Process ', 'Caught processing coka leaves \nfound 96 leaves and 1 coke in his pocket \nkW204u81wZX2109 (finger print) ', '{\"Poss. Illegal Contraband\":1,\"Drug Cultivation/Manufacturing\":1}', 'AirahTV', 'John Marshall', '09-10-2021 12:28:06'),
(9, 'GNW54259', 'mcbluntz GTA', 'Failed to stop in a red feltzer, reckless driving, evasion', '{\"Grand Theft Auto\":1,\"Reckless Endangerment\":1,\"Reckless Driving\":1}', 'Simon', 'Jay Mcbluntz', '09-10-2021 12:52:05'),
(10, 'GNW54259', 'Running away from BCSO/LSPD', 'officers involed\n\n@501 F. McDirty\n@807 S. Sanchez\n@804 L. Haynes\n\nS. Sanchez and F. McDirty where in a prusit and all the other officers that are listed. Jay McBluntz was driving recklessly aross the los santos fwy. Officers started pitting him once his car broke down, Jay McBluntz took off running leading him down in the sewers where he was tazed and cuffed on scene.', '{\"Grand Theft Auto\":1,\"Felony Evading/Eluding an LEO\":1,\"Reckless Driving\":1}', 'Sakiente', 'Jay Mcbluntz', '09-10-2021 12:56:30'),
(11, 'LEO31469', 'Vasso 3x Evading + Cocaine', 'Subject failed to stop 3x was on a motorbike, gun pointed to head, taser pointed to head still failed to stop, He was then pitted off his bike and taken into custody where a search found 21 bags of cocaine', '{\"Reckless Driving\":1,\"Drug Cultivation/Manufacturing\":1,\"Felony Evading/Eluding an LEO\":1}', 'Simon', 'Vasso Junior', '09-10-2021 13:10:05'),
(12, 'LTK60944', 'Stolen Police Car and armed robbery', 'Tobi stole a police car outside integrity and then was caught later on in an armed store robbery with one Hostage.', '{\"Criminal Possession of a Class I Firearm\":1,\"Grand Theft Auto\":1,\"Attempted Murder of a Government Official\":1,\"Kidnapping\":1,\"Armed Robbery\":1}', 'Mikey', 'Tobi Gibbs', '09-10-2021 13:40:55'),
(13, 'UQL10718', 'Armed Robbery', 'Yuno was caught in an Armed robbery at grove street gas station and was found with a criminal possession of a class 1 firearm', '{\"Felony Speeding/Reckless Driving\":1,\"Kidnapping\":1,\"Criminal Possession of a Class I Firearm\":1,\"Armed Robbery\":1}', 'Mikey', 'YUNO JUNO', '09-10-2021 13:55:22'),
(14, 'AKO81297', 'attempted murder LEO', 'attended a shot at officers on brouge street were the suspect got off his bike and started shooting officers. SGT Maguire was downed in the fire fight, the suspect was also downed. \n\nFine... $4500\nTime... 20months\nguilty plea', '{\"Criminal Possession of a Class I Firearm\":1,\"Attempted Murder of a Government Official\":1,\"Felony Evading/Eluding an LEO\":1}', 'Irish', 'Harvey Price', '09-10-2021 14:14:03'),
(15, 'GNW54259', 'Mcblutz attemt to steal a car and stole a vehicle ', 'Suspect stole a vehicle in front of me 701 I.abdulov near auto exotics. we chased the suspect throught the city while he was driving reckless. he hit multiple people and post ', '{\"Grand Theft Auto\":1,\"Attempted Grand Theft Auto\":1}', 'BanksyXI', 'Jay Mcbluntz', '09-10-2021 16:13:48'),
(16, 'NRU59496', 'Ace tries to rob a store', 'Officers involved:\n@804 L Haynes\n@702 N.Mcquire\n\nOfficers got a call of a 10-90 on grove street. When officers arrived the suspects were behind the counter robbing the store without a hostage. The officers said they needed signs of life or see a hostage or the officers will breach. The officer breached and officer Mcquire went down in the gun fight. Officer haynes shot and downed both suspects.\nSuspect plead guilty', '{\"Armed Robbery\":1}', 'ifeltlikerunin', 'ACE Richards', '09-11-2021 09:54:58'),
(17, 'BXG60906', 'store robbery (armed)', 'responed to a store robbery at LTD grove street, the 2 suspects opened fire as they did not have a hostage. they were downed and pleaded guilty', '{\"Armed Robbery\":1}', 'Irish', 'Jay Henz', '09-11-2021 09:57:13'),
(18, 'BBK14903', 'Robbery ', 'Officers on scene\n\n@807 S. Sanchez\n@703 N. Maguire\n@804 L. Haynes\n\nAs the officers showed up to the latest store robbery 1 suspect name Jacob Jenkins was seen getting on a Sanchez Dirt Bike. As he did comply to the officers he was arrested and sent to MRPD.\n\nPlead - Guilty\n', '{\"Armed Robbery\":1}', 'Sakiente', 'Jacob Jenkins', '09-11-2021 10:27:20'),
(19, 'XEL90978', 'Robbery of a store', 'Officers invovled:\n@804 L. Haynes\n@807 S. Sanchez\n@702 N. Mcguire\n\nOfficer McGuire was on a cam of a store robbery giving the description of a man in a grey vest white shirt with white hair. He left the store and was in grey in color dominator. Officers found the vehicle and attempted to pull Mr john over. John lead officers on a 15 min pursuit when officers started to perform a pit. The suspects car was smoking and officers lost visual. Officers found the car abandoned and searched the area. Officers found John hiding in a bush and arrested him.\nSuspect plead no contest. ', '{\"Attempted/Unarmed Robbery\":1,\"Felony Evading/Eluding an LEO\":1,\"Reckless Driving\":1}', 'ifeltlikerunin', 'John Devito', '09-11-2021 12:01:24'),
(20, 'ALJ54734', 'Roy bonner spice head', 'As i approached paleto bay i caught 2 subjects 1 being Mr bonner on the side of the highway clutivating Spice a well known narcotic, after a search we found 80 bags of spice and a illegal firearm, was complient and cooperative - 20 months in jail.', '{\"Criminal Possession of a Class I Firearm\":1,\"Drug Cultivation/Manufacturing\":1}', 'Simon', 'Roy Bonner', '09-11-2021 14:01:35'),
(21, 'GNW54259', 'Jay Mcbluntz | Arrest | 09/11/2021', 'Officer(s) Involved:\n813 - Dalton Mahoney\n\nItem\'s Confiscated:\nNone\n\nIncident Report:\n813 responded to an assistance request with 801 where we found 805 in pursuit where we found Mr. Mcbluntz evading where he then ran over an individual and almost killed him. After doing this he was pitted by officers before his car was disabled and he then jumped off of the cliff. \n\nNote(s):\n- Suspect Pleaded:  Not Guilty\n- Total Time:30\n- Total Fine: $500', '{\"Assault with a Deadly Weapon\":1,\"Joyriding\":1,\"Reckless Driving\":1}', 'MahoneyFiveMTTV', 'Jay Mcbluntz', '09-11-2021 15:02:40'),
(22, 'YJB31450', 'Shaun Pickering | Arrest | 09/11/2021', 'Officer(s) Involved:\n813 - Dalton Mahoney\n\nItem\'s Confiscated:\nN/A\n\nIncident Report:\n813 pulled up to legion garage and saw Mr. Pickering fighting an individual and stealing their car. After stealing it he then fled from officers in the vehicle before being pushed into a wall next to bennys and putting his hands up. After this he was detained, searched and read his rights\n\nNote(s):\n- Suspect Pleaded: Guilty\n- Total Time: 15\n- Total Fine: $450', '{\"Grand Theft Auto\":1,\"Felony Evading/Eluding an LEO\":1}', 'MahoneyFiveMTTV', 'Shaun Pickering', '09-11-2021 15:21:55'),
(23, 'LBV75269', 'Unarmed Robbery', 'Officers on scene\n\n@804 L. Haynes\n@807 S. Sanchez\n\nAs the officers approched the store the guy procceded to get in the veichle and procceded to flea away crashing into poles and everthing after he did end up crashing and came to a complete stop, and ended up complying and was arrested on scene.', '{\"Attempted/Unarmed Robbery\":1,\"Reckless Driving\":1}', 'Sakiente', 'Rab McTav', '09-11-2021 15:41:37'),
(24, 'NZN96455', 'Dark Driver | Arrest | 09/11/2021', 'Officer(s) Involved:\n813 - Dalton Mahoney\n\nItem\'s Confiscated:\n2x lockpick\n1x wrench\n\nIncident Report:\n813 responded to a store robbery on clinton ave where 2 individuals were inside with 1 hostage. After speaking with them we got the hostage saftely out and then chased them where they went into the tunnels and ran from officers. After running they gave up and were detained\n\nNote(s):\n- Suspect Pleaded: Guilty\n- Total Time: 20\n- Total Fine: $400', '{\"Attempted/Unarmed Robbery\":1,\"Kidnapping\":1,\"Felony Evading/Eluding an LEO\":1}', 'MahoneyFiveMTTV', 'Dark Driver', '09-11-2021 17:02:01'),
(25, 'NRU59496', 'Store Robbery', 'Officers on scene \n\n@807 S. Sanchez\n@102 T. Fedecini\n@813 D. Mahoney\n\nAs the officers arrived on scene the 2 guys by the name of \"Ace Richard\" and \"Dark Driver\" had a hostage that was a bald man he was a mute. They had him handcuffed as the hostage was let go, officers chased the car down to the tunnels and S. Sanchez was assulted by \"Ace Richard after he was cuffed and taken to the hospital to get treated. After was taken in for proccesing\n\nPlead - Guilty', '{\"Attempted/Unarmed Robbery\":1,\"Felony Evading/Eluding an LEO\":1}', 'Sakiente', 'ACE Richards', '09-11-2021 17:09:28'),
