(39, 'QPW38927', 'Evadeing BSCO', 'BSCO Report\n\nReporting Officer\n\n@807 S. Sanchez\n\nAssisting Officer\'s\n\n@101 T. Stove\n@102 T. Fedecini\n@702 N. Maguire\n@801 O. Scott\n\nAs Air-1 was hovering about the coke prossessing yard, Officer Scott and Officer Maguire spotted 5 people waking around the area. As Officer Sanchez and Officer Fedcini Approached the yard they suspects procceded to run away as sanchez and officer stove chased down one suspect by the name of \"Bobby King\" running to incoming traffic as he was tackled more than 3 times as a car approched the chase he tried to get in the vehicle and failed to get in Bobby King ended up giving up and was put in cuffs on scene.\n', '{\"Poss. Illegal Contraband\":1,\"Criminal Possession of a Class I Firearm\":1,\"Evading Arrest ( Foot )\":1,\"Drug Cultivation/Manufacturing\":1,\"Felony Evading/Eluding an LEO\":1}', 'Sakiente', 'Bobby King', '09-12-2021 17:38:50'),
