(41, 'LEO31469', 'fleeing & eluding', ' STATE OF SAN ANDREAS\n[BLAIN COUNTY SHERRIFFS OFFICE]\n\nARREST REPORT\n\n[sr officer] [petey] [bcso]\n\nFOLLOWING OCCURED ON 13/09/2021\n\nINCIDENT DESCRIPTION\n703 responded to a 10-80 in paleto bay, the chase went on for 15 minutes heading from paleto all the way back to LS where the chase ended in a 10-50 of the suspect into a gas station, suspect was transport to pbms for medical treatment and was read his right after treatment and him confirming his rights, \nsuspect was brought to mrpd for processing where he plead guilty to the listed charges and was send to 10months with a 450$ fine.\n\nSEIZURE/EVIDENCE\n-\n\nUSED VIOLENCE\n[NO]\n\nLEGAL AID\n[NO]\n\nPLEAD [GUILTY]\n\nSENTANCE:10\nFINE:450\n', '{\"Failure to Identify\":1,\"Failure to Stop\":1,\"Felony Evading/Eluding an LEO\":1}', 'miner_robinotten', 'Vasso Junior', '09-13-2021 11:39:46'),
