(44, 'BZM14088', 'Michael Bsause | Arrest | 09/13/2021', 'Officer(s) Involved:\nDalton Mahoney - 813\n\nItem\'s Confiscated:\npistol x1\n\nIncident Report:\n813 and 801 tried to stop Mr. Bsause who was running on foot and stop him to speak to him about his driving, he tried to get in a car and takeoff and was tased, after being tased he ran more before being tackle and then taken into custody where he was brought to MRPD for processing.\n\nNote(s):\n- Suspect Pleaded: Guilty\n- Total Time:15\n- Total Fine: $450', '{\"Evading Arrest ( Foot )\":1,\"Criminal Possession of a Class I Firearm\":1}', 'MahoneyFiveMTTV', 'Michael Bsause', '09-13-2021 13:23:08'),
