(46, 'DKZ21669', 'Clara opal tries to drift', 'Officers invovled\n@704 L. Haynes\n@807 S. Sanchez\n@702 N. Mcquire\n\nOfficers were on patrol when they saw a red in color car drifting around corners and hitting poles. Officers tried to pull over the car but the person refused. The person pulled into pillbox and stopped. The person was identified as Clara Opal. She then took off and lead officers on a chase. She then picked up Dimitri and they kept driving away from officers. The chase ended up in the tunnels where clara\'s vehicle crashed. She then lead officers on a foot chase and she was arrested shortly after.\n', '{\"Reckless Driving\":1,\"Felony Evading/Eluding an LEO\":1}', 'punti', 'Clara Opal', '09-13-2021 13:29:12'),
