(48, 'BVX79969', 'Running away in a drift car', 'BCSO Report\n\n\nReporting Officer\n@807 S. Sanchez\n\nAssisting Officer\'s\n@804 L. Haynes\n@905 D. Doe\n\n\n\nLocation: On the Highway \n\nSummary:\nAs the officers apporched the drifting vehicle Sanchez pointed a tazer at the female suspect telling her to get out or you will be tazed. The female decided to flea away and was in a active 10-80. Following behind the suspect the female driver known as \"Clara Opal\" was driving recklessly all over the roads running into lights poles and anything on site. As the officers chased down the suspects to the tunnels that 10-50 and procceded on foot Sanchez chased the male suspect on foot and was running into imcoming trafic as he was tazed several times in the back and chest he did end up giving up and was put in cuffs on scene and sent to pillbox for medical treatment.', '{\"Evading Arrest ( Foot )\":1,\"Felony Evading/Eluding an LEO\":1}', 'Sakiente', 'Dimitri Smirnov', '09-13-2021 13:36:54'),
