(51, 'LTK60944', 'Evading police on a motorcycle', 'Officers invovled\n@704 L. Haynes\n@102 T. Fedecini\n@804 S. Sanchez\n\nOfficers attempted to pull over a orange in color motorcycle. The motorcycle stopped for min but then took off from officers. Tobi later approached sr. officer Haynes and said he wanted to turn himself in for evading early. He admitted to running and didnt want to be on the run from police. He plead guilty and was sent for 10 months.', '{\"Felony Evading/Eluding an LEO\":1}', 'punti', 'Tobi Gibbs', '09-13-2021 14:31:36'),
