(58, 'LMP66307', 'Miles Smith | Arrest | 09/13/2021', 'Officer(s) Involved:\n813 - Dalton Mahoney\n\nItem\'s Confiscated:\nHeavy, Draco, 5 rifle ammo\n\nIncident Report:\n813 responded to a fleeca where 4 individuals were inside 2 with class 2s. After leaving the bank they took off until wrecking on a stair case. After wrecking out they opened fire on officers and got shot down. After that they were given medical then transported to MRPD for processing.\n\nEvidence:\nPockets- https://cdn.discordapp.com/attachments/882554266429063210/887100075279540274/20210913165859_1.jpg\nMugshot-https://cdn.discordapp.com/attachments/882554266429063210/887100080656629770/20210913171023_1.jpg\nFingerprint- https://cdn.discordapp.com/attachments/882554266429063210/887100076642672671/20210913170940_1.jpg\n\nNote(s):\n- Suspect Pleaded: Guilty\n- Total Time:50\n- Total Fine:$1850', '{\"Kidnapping\":1,\"Aggravated Armed Robbery\":1,\"Criminal Possession of a Class I Firearm\":1,\"Attempted Murder of a Government Official\":1,\"Felony Evading/Eluding an LEO\":1,\"Possession of a Class II Weapon\":1}', 'MahoneyFiveMTTV', 'Miles Smith', '09-13-2021 15:27:01'),
