(62, 'LEO31469', 'Vasso steals a cop car', 'Officers invovled:\n@704 L. Haynes\n@804 S. Sanchez\n@702 N. Mcguire\n211 months 17000\n\nOfficer Haynes got on duty and was patroling legion square. Haynes saw a police charger going up elgin ave. Haynes radio\'d in to see what officer was driving the charger. Haynes noticed he was the only one on duty before leaving mrpd. Haynes thought that it was a officer that just fogot to say 10-41. When haynes approached the vehicle there was a man with a grey head wrap on and no shirt driving the car. Haynes tried to pull over the vehicle but he didnt pull over and a chase ensued. Officer Mcguire and sanchez got on duty and haynes told them he was chasing a stolen police cruiser.\nMcguire ended up shooting the suspect down behind the vault and arrested the suspect. Vasso pleaded not guilty and was sent in for the 9\'s.    \n', '{\"Grand Theft Auto\":1,\"Felony Evading/Eluding an LEO\":1,\"Poss. Illegal Contraband\":1,\"Criminal Possession of a Class I Firearm\":1}', 'ifeltlikerunin', 'Vasso Junior', '09-14-2021 10:58:08'),
