(78, 'LTK60944', 'Tobi Gibbs | Arrest | 09/15/2021', 'Officer(s) Involved:\n813 - Dalton Mahoney\n\nItem\'s Confiscated:\n11x joints\n3x lockpick\n\nIncident Report:\n813 pulled over Mr. Gibbs on south bound strawberry ave where Mr. Gibbs didnt have his license. After being escorted to Integrity and getting his license, 813 approached about why he was in a stolen vehicle. After asking Mr. Gibbs about it he started to evade officers in a vehicle. After evading for approximately 5 minutes he was pitted into a wall where he ended up on his side. After doing this he stepped out with his hands up, was cufed, read his rights, searched, and brought to mrpd for processing. \n\nEvidence:\nhttps://cdn.discordapp.com/attachments/884556190217019423/887648881653997598/20210915062409_1.jpg Pockets\nhttps://cdn.discordapp.com/attachments/884556190217019423/887648883306557470/20210915062629_1.jpg fingerprint\nhttps://cdn.discordapp.com/attachments/884556190217019423/887648887198851093/20210915062650_1.jpg mugshot\n\n\nNote(s):\n- Suspect Pleaded: Guilty\n- Total Time:20\n- Total Fine: $3075\n', '{\"Possession of Stolen Property\":1,\"Felony Speeding/Reckless Driving\":1,\"Poss. of a CDS Schedule I w/ Intent to Sell\":1,\"Joyriding\":1}', 'MahoneyFiveMTTV', 'Tobi Gibbs', '09-15-2021 03:37:53'),
(80, 'FAR97459', 'Christian Tomson | Arrest | 09/15/2021', 'Officer(s) Involved:\n813 - Dalton Mahoney\n\nItem\'s Confiscated:\n3x Vibe Pad\n\nIncident Report:\n813 responded to a house robbery in gang territory next to the Go Postal building. Upon waiting he found Mr Tomson leaving the house. After seeing him leave the house he was held at gunpoint and detained and read his rights for questioning and investigation. After investigating it was found he was robbing the house. He was then searched and brought to MRPD for processing.\n\nNote(s):\n- Suspect Pleaded: Guilty\n- Total Time:10\n- Total Fine:$500', '{\"Attempted/Unarmed Robbery\":1}', 'MahoneyFiveMTTV', 'Christian Tomson', '09-15-2021 07:24:42'),
