(82, 'LMP66307', 'Miles Smith | Arrest | 09/15/2021', 'Officer(s) Involved:\n813 - Dalton Mahoney\n\nItem\'s Confiscated:\n1x lockpick\n\nIncident Report:\n813 was running radar north bound elgin ave when he found Mr. Smith going 68 and blowing through a redlight. Upon stoping him it was found he was in possession of a stolen car. He was then detained, read his rights, and searched before being brought to MRPD for processing. \n\nNote(s):\n- Suspect Pleaded: Guilty\n- Total Time:10\n- Total Fine:750', '{\"Grand Theft Auto\":1,\"Speeding 15 MPH Over\":1,\"Failure to Stop\":1}', 'MahoneyFiveMTTV', 'Miles Smith', '09-15-2021 07:45:32'),
(83, 'ISO09841', 'Albert Anus Profile - HY207R99aUo4237', 'Officer(s) Involved: [804,813] - \n[Officer\'s Name] Brandon Russolini, Dalton Mahoney\nItem\'s Confiscated: None\nIncident Report: Attempted to pull suspect over after arriving on scene of a fight. Suspect was in possession of a stolen vehicle and uncooperative during traffic stop before initiating a chase. Chase ended after a successful pit manuever by Officer 813.\nEvidence: Stolen vehicles plates are 24TER269\nNote(s):\nSuspect Pleaded: [Guilty]\nTotal Time 15 months\nTotal Fine $1150', '{\"Grand Theft Auto\":1,\"Felony Evading/Eluding an LEO\":1,\"Felony Speeding/Reckless Driving\":1}', 'Mutant Havoc', 'Albert Anus', '09-15-2021 09:07:44'),
