(89, 'FKW73033', 'Posh Tom evades police', 'Officers involved\n@704 L. Haynes\n@101 T. Stove\n\nOfficer Haynes was patroling around legion square when a 4 door purple in color vehicle was speeding through red lights. Officer Haynes tried to pull the vehicle over but it failed to yeld. A chase was insued and the vehicle kept driving into oncoming lanes hitting multiple vehicles. After a long chase a Man in a white suit and blond hair exited the car with his hands up. This man was identified as Posh Tom. Posh tom had a bag of coke and a tunerchip on his person.\n\n\n', '{\"Illegal Vehicle Modifications\":1,\"Reckless Driving\":1,\"Felony Evading/Eluding an LEO\":1,\"Poss. Illegal Contraband\":1}', 'ifeltlikerunin', 'Posh Tom', '09-17-2021 15:11:14'),
