(91, 'SJL69940', 'Drugs | Spice Field ', 'BCSO Report\n\n\nReporting Officer\n@807 S. Sanchez\n\nAssisting Officer\'s\n@101 T. Stove\n@704 L. Haynes\n@905 D. Doe\n\nLocation: Spice Field \n\nSeized Items:\n\n1x Pistol\n70x Spice Leafs\n19x Coke Leafs\n1x Pisol ammo\n\n| Guilty |\n\nSummary:\n\nAll the assisting officer\'s where scouting the spice field area in Air-1 after all officers got in a crusier they procceded to drive along the backside of the spice field on the train tracks and spotted 2 guys. One of the guys where complying as for the other decided to get in his car and hit one of the officers named S. Sanchez with his vehicle. As for the one that was complying he was arrested and prossessed to MRPD.\n', '{\"Drug Cultivation/Manufacturing\":1,\"Criminal Possession of a Class I Firearm\":1}', 'Sakiente', 'Bobby Dickenbottom', '09-17-2021 15:47:21'),
