(93, 'KXH98864', 'Drugs | Spice Field |', 'BCSO Report\n\n\nReporting Officer\n@807 S. Sanchez\n\nAssisting Officer\'s\n@101 T. Stove\n@905 D. Doe\n\nLocation: Spice Field \n\nSeized Items:\n\n42x Pistol\n20x Spice Leafs\n1x Pisol Mk 2\n2x Bands\n\nCharged: $2500\n\n| Guilty |\n\nSummary:\nAs the offcer T. Stove spotted a guy picking spice leafs at the spice field, we speeded up and told the suspect to put his hands up he was very complant and he was arreseted on scene and sent down to MRPD.', '{\"Drug Cultivation/Manufacturing\":1,\"Possession of a Class II Weapon\":1,\"Poss. Illegal Contraband\":1}', 'Sakiente', 'Luke Robert', '09-17-2021 16:38:31'),
(94, 'HLA11517', 'Vangelico Robbery, shots fired at officers', 'Officers got a call to a robbery at the vangelico jewelry place, when us officers arrived, there was 3 people armed with pistols and one with an automatic pistol, suspects had one hostage on the ground with guns pointed to his head. suspects wanted free spike strips and free passage in order to let the hostage go. suspects got into a 10-80 for around 35-40 mins, suspects could not flee so lead to integrity where shots was fired and suspects was taken down, \n\nkyle plead guilty\ntime=142\nfine=11750', '{\"Felony Evading/Eluding an LEO\":1,\"Brandishing a Firearm\":1,\"Armed Robbery\":1}', 'Noggy', 'Kyle Marshall', '09-18-2021 15:04:55'),
(95, 'SJL69940', 'Jewelery store Robbery participent', 'Bobby was involved in a robbery at jewelery store robbery. \n\nUnknown if he was the driver but was in a vehicle that was chased by police, suspect was definately\n\nSuspect was gunned down in a firefight and taken to pillbox\n\nsuspect was in posession of a SNS pistol\n\ncharges 121, 117, 209, 701, 800, 810\nfine 9975\njail 150\n\nSuspect was unable to pay the fine in full, 5 months was added to their stay at prison and they have 1 week to pay\n', '{\"Assault with a Deadly Weapon\":1,\"Aggravated Armed Robbery\":1,\"Armed Robbery\":1}', 'SilentS1221', 'Bobby Dickenbottom', '09-18-2021 15:10:27'),
