(97, 'APA33275', 'Drug Manufactoring', 'Officers Involved:\n102 T. Fedecini\n\nDetail:\nCastor along with another suspect were seen at an Illegal Drug Processcing Factory processing huge amount of drugs. They then jumped into a Black and Grey Sabre Turbo and led the police on 12 minute state wide chase. Castor then jumped out of the car inside the LS Tram Tunnels where officer 102 then made the arrest. The driver managed to escape.\n\nItems found:\nCoke Baggie X1\nSpice Leafs X196\nSpice Baggie X61\nCrypto Sticks X6', '{\"Felony Evading/Eluding an LEO\":1,\"Drug Cultivation/Manufacturing\":1,\"Poss. Illegal Contraband\":1}', 'Mikey', 'Castor Troy', '09-18-2021 17:19:56'),
