(105, 'HLA11517', 'Shootout', 'Officers involved\n@704 L. Haynes\n@804 S. Sanchez\n@102 T. Fedecini\n@902 K. Bushwacker\n\n\nOfficers responded to multiple shots fired call from legion square. Officers witnessed a purple in color 4 door belonging to Kyle marshall shooting at a motorcycle. The motorcycle fled and the officers attempted to perfom a felony stop on the purple in color 4 door. The vehicle took and started to ram officers. Officers attempted to pit the vehicle when the suscpets started to shoot at officers. The officers shot back and pitted the vehicle in a wall by the casino. Officers shot down all the suspects.\n\nKyle Plead Guilty.\n\n\n\n\n15 months 2000\n50 months 15000\n5 month 300\n500\n20 1500\n\n', '{\"Illegal Vehicle Modifications\":1,\"Assault with a Deadly Weapon\":1,\"Felony Evading/Eluding an LEO\":1,\"Poss. Illegal Contraband\":1,\"Possession of a Class II Weapon\":1}', 'punti', 'Kyle Marshall', '09-21-2021 12:40:01'),
(106, 'FUZ44648', 'Shooting on the highway', 'BCSO Report\n\n\nReporting Officer\n@807 S. Sanchez\n\n\nLocation: Highway\n\nSeized Items:\n\nPistol x1\n\n\n\n| Guilty |\n\nSummary: As all the officers where trying to pull over a 4 door purple car, it leaded to a 10-80 and we ended up 10-50 on the highway then shots where fired on the highway and all the suspects are down, they where arrested on scene and sent to pill box medical.', '{\"Attempted Murder of a Government Official\":1,\"Drug Cultivation/Manufacturing\":1,\"Criminal Possession of a Class I Firearm\":1,\"Poss. Illegal Contraband\":1,\"Assault with a Deadly Weapon\":1}', 'Sakiente', 'Tom Dickenbottom', '09-21-2021 12:43:48'),
(107, 'GNW54259', 'Jay Mcbluntz | 21/09/21 | ', 'involved officers: 902, 807, 502, 101\n\nmonths original -96\nfine original - 7500\n\nreduced months - 96\nreduced fine - 7000\nI responded to shots fired at legion garage alongside 502 we see a purple vehicle shooting and being shot at by a motor bike. all officers attempt a felony stop on the purple vehicle but they flee. We chase them until they are involved in a 10-50 to where there car is un drivable. all 3 of the vehicles occupents in car escape on foot. i see jay run into the bush. we ask him to put his hands up. he declines and he reaches so me and 502 shot him until he was no longer capable of causing injury to officers. He was taken to pillbox then to the station and his gsr test came back possitive\nIdentified-Fingerprint', '{\"Felony Evading/Eluding an LEO\":1,\"Criminal Possession of a Class I Firearm\":1,\"Assault with a Deadly Weapon\":4}', 'TwiistedBlizzard', 'Jay Mcbluntz', '09-21-2021 12:45:18'),
