(113, 'BVX79969', 'Jewerly store', 'officers ivolved:\n@102 T. Fedecini\n@101 T. Stove\n@801 O. Scott\n@804 L. Haynes\n@701 I. Abdulov\n@810 M. Hernandez\n\n\nOfficers responded to a jewerly store robbery where there was a hostage. The suspects left the jewerly store and was in a pursuit with police. The pursuit ended up at the factory where the suspects shot at officers. All suspects were downed and arrested.\n\n\n\n\n\n\nfirearm- 6 500\n30 2000-robbery\n7 750 joyriding\n50 6000 murder\n25 2250-kidnapping\n11,500 fine time-118 months', '{\"Kidnapping\":1,\"Joyriding\":1,\"Attempted Murder of a Government Official\":1,\"Armed Robbery\":1,\"Criminal Possession of a Class I Firearm\":1}', 'punti', 'Dimitri Smirnov', '09-21-2021 16:00:20'),
