(117, 'LEO31469', 'Vasso runs from a trooper bike', 'Officers involved:\n@704 L. Haynes\n\nOfficer haynes witnessed a motorcycle driving fast on strawberry ave running red lights. Haynes attempted to pull over Vasso whom was driving on his fast motorcycle. After a 8 min chase vasso crashed out and was downed. He was taken to pillbox for treatment and then mrpd.\nVasso plead guilty.\n\n\n6 500\n10 800\n10 1000', '{\"Felony Evading/Eluding an LEO\":1,\"Reckless Driving\":1,\"Criminal Possession of a Class I Firearm\":1}', 'ifeltlikerunin', 'Vasso Junior', '09-22-2021 08:54:22'),
(118, 'LEO31469', 'Reckless Driving & Grand Theft auto', 'Vasso was caught after a 30 minute chase all around Los Santos after stealing a Komoda from Integrity. He also was kicking a Police vehicle in front of integrity previously.\n\nOfficers Involved:\n102 T. Fedecini\n\nItems Found:\n20X Band Rolls', '{\"Failure to Stop\":1,\"Failure to Yield to Emergency Services\":1,\"Grand Theft Auto\":1,\"Felony Speeding/Reckless Driving\":1,\"Failure to Obey a Lawful Order\":1,\"Speeding 30 MPH Over\":1,\"Wrong Way of Travel\":1,\"Vandalism/Destruction of Property\":1,\"Reckless Driving\":1,\"Failure to Identify\":1,\"General Speeding\":1,\"Illegal U-Turn\":1}', 'Mikey', 'Vasso Junior', '09-22-2021 11:08:09'),
