(122, 'KLT57701', 'Adam Smith| 22/09,21 | Criminal possesion of class 1', 'original time-11\noriginal fine-1000\nreduced time-11\nreduced fine-700\n\nofficers involved- 102,902\n\nMe and 902 arrived at a shots fired outside the bank. We see two people downed outside and 1 person running away from the bank. We stop this said person and he stated he was being took hostage for a bank robbery and his mate(adam ) shot them both down. We then see adam at pill box so we demand him to step off his bike and he is detained. he then comes back positive on a gsr test and admits to his crime. \n\nPleaded: Guilty \n', '{\"Negligent Discharge  of a Firearm\":1,\"Criminal Possession of a Class I Firearm\":1}', 'TwiistedBlizzard', 'Adam Smith', '09-22-2021 12:26:42'),
(123, 'DVB18895', 'Possession of a Class II firearm & Possession of Robbery Equipment', 'Jedd was caught outside fleeca bank after been shot by another suspect. He admitted to trying to rob the bank. He was also caught with Thermite and a gate Cracker.\n\nOfficers Involved:\n102 T. Fedecini\n902 K. Bushwacker\n\nItems found:\nGate Cracker X1\nThermite X1\nAP Pistol X1', '{\"Possession of a Class II Weapon\":1,\"Possession of Burglary Tools\":1}', 'Mikey', 'Jedd Proppers', '09-22-2021 12:59:50'),
(124, 'GNW54259', 'Reckless Driving, Evading and Eluding an LEO', 'Officers Involved:\n102 T. Fedecini\n502 R. Dazzler\n902 K. Bushwacker\n\nJay Mcbluntz was speeding around the state of San Andreas in a Black R35. Officers went to try and pull him over but he ignored the lights and sirens. So he led the police on a state wide chase till the chase was terminated near Vinewood Bowl.\n\nItems Found:\nHandcuffs X1\n\nPleaded Guilty and Recived a 30 Months Prison Sentence and a $4600 Fine.', '{\"Failure to Stop\":1,\"Reckless Driving\":1,\"Failure to Maintain Lane\":1,\"Felony Speeding/Reckless Driving\":1,\"Felony Evading/Eluding an LEO\":1,\"Reckless Endangerment\":1,\"Failure to Obey a Lawful Order\":1,\"Failure to Yield to Emergency Services\":1,\"Possession of Stolen Property\":1}', 'Mikey', 'Jay Mcbluntz', '09-22-2021 13:16:44'),
