(126, 'MMG42620', 'Albert Butlicker | Attempted GTA', 'original Fine $2750\noriginal Time 15 months\nreduced fine 0 dollars\nreduced time28 months\n\nofficers involved-902, 102\n\n902 and 102 attempted a traffic stop on a wrecklessly driving amg. But at we attempted to pull him over he fled the scene. We enrolled a 10-80 but half way through the chase we went vcb. A short time later the vehcile is spotted again. We try to pull him over again but he runs he later tried running on foot away from an officer. after a foot pursuit he tries to get in a cop vehicle and is shot unconcious. When he went down we could not see him body anywhere so we searched the area but had no look. within 10 minuts he recievce a 911 call from the downed suspect. We then take him to pillbox. he is helped by ems and undergoes surgery to remove the bullets and then tries to run out of pillbox and is tased.', '{\"Speeding 30 MPH Over\":1,\"Reckless Driving\":1,\"Attempted Grand Theft Auto\":1}', 'TwiistedBlizzard', 'Albert Butlicker', '09-23-2021 14:54:59'),
