(131, 'KJW50650', 'yacht robbery 25/09/2021', 'Officers attended to a yacht robbery where officers was shot upon arrival, supsect then went into the water and flead into a red and coloured komoda. suspect continued to shoot at air-1 and i. suspect shot down air-1 and fleas to the ammunation near the docks where Mr Maguire was shot down by 502 R.Dazzler.\nseized pistol, tunerchip\ntime-200\nfine-23000\nplead guilty', '{\"Attempted Murder of a Government Official\":3,\"Armed Robbery\":1}', 'Noggy', 'FrMicheal Maguire', '09-25-2021 12:30:08'),
(133, 'SGH26538', 'Ticket', 'Got a 911 call bout Mr.Harris car driving recklessly and traffic cams show his vehicle running red lights.', '{\"Reckless Driving\":1}', 'Braxton Wedge', 'Zander Harris', '04-04-2022 18:25:36'),
(134, 'TJR31125', 'Arrest ', 'Got a call for a fight in progress. Responded code 3 to the call when I got there he tried to steal a bus. I depolyed my taser. Brought them down to the station and booked them.\nMarshal: Rocco Astarita ', '{\"Grand Theft Auto\":1,\"Assault\":1}', '(1stCav)[M] Pvt. Trooper', 'jeremiah Herman', '04-05-2022 18:28:09'),
(135, 'UBD30651', 'Wanted ', 'Using twitter i was able to make contact with the suspect and agree to a drug by at a car dealership. When I attempted to arrest the subject he refused to get out of his vehicle and ran. A pursuit followed. I caught up to the suspect after they had totaled their vehicle and fined one with charges. Tyrone did not return to his vehicle. ', '{\"Poss. of a CDS Schedule I w/ Intent to Sell\":1,\"Theft of a Motor Vehicle\":1,\"Felony Evading/Eluding an LEO\":1}', 'Destrow', 'Tyrone Biggons', '04-07-2022 18:37:06'),
